import React from 'react';
import { Link, Route, Routes } from 'react-router-dom';
import Logo from '../Logo/Logo';
import './Header.css';

function Header() {
  return (
    <header className='header'>
      <Logo />
      <Routes>
        <Route
          path='/'
          element={
            <nav className='header__nav'>
              <ul className='header__nav-list'>
                <li className='header__nav-list-item'>
                  <Link
                    className='header__nav-link'
                    to='/signup'>
                    Регистрация
                  </Link>
                </li>
                <li className='header__nav-list-item'>
                  <Link
                    className='header__nav-link header__nav-link_type_login'
                    to='/signin'>
                    Войти
                  </Link>
                </li>
              </ul>
            </nav>
          }
        />
        <Route
          path='/movies'
          element={
            <>
              <div
              // className={`header__container ${isBurgerActive ? 'header__container_active' : ''}`}
              >
                <p className='header__email'>email</p>
                <button
                  className='header__logout'
                  // onClick={onSignOut}
                >
                  Выйти
                </button>
              </div>
              <div
              // className={`header__burger ${isBurgerActive ? 'header__burger_active' : ''}`}
              // onClick={onOpenHeader}
              >
                <span className='header__burger-line'></span>
                <span className='header__burger-line'></span>
                <span className='header__burger-line'></span>
              </div>
            </>
          }
        />
      </Routes>
    </header>
  );
}

export default Header;
